import React, { useEffect } from "react";
import axios from "axios";

const Protected = () => {
  const getProtected = async () => {
    try {
      const res = await axios.get("/protected");
      console.log("res ", res);
      if (res.status === 200) {
        window.location.reload();
      } else {
        window.location = "http://localhost:5000/";
      }
    } catch (e) {
      console.log(e);
    }
  };

  useEffect(() => {
    getProtected();
  }, []);
  return <div>401</div>;
};

export default Protected;
